import React, { FC } from 'react'
import { useDispatch } from 'react-redux'
import { quantityAdd } from '../../../store/orderSlice'

interface NumberStepperProps {
    quantityLess: (id: number) => void
    quantityAdd: (id:number) => void
    quantity: number
    id: number
}

const  NumberStepper:FC<NumberStepperProps> = ({ quantity, id}) => {
  const dispatch = useDispatch()
  return (

    <div className='flex space-x-6 w-12 text-lg mt-2 pl-24 '>
    <button onClick={() => dispatch(q(id))}>-</button>
    <input value={quantity} className='text-center w-12 text-lg' />
    <button onClick={() => dispatch(quantityAdd(id))}>+</button>
  </div>

  )
}

export default NumberStepper
